INSERT INTO `news` VALUES (7,'SỨC KHỎE & LÀM ĐẸP THEO TIÊU CHÍ HIỆN ĐẠI','images (1).jpg','<p>Bất kỳ ai trong ch&uacute;ng ta cũng đều muốn ng&agrave;y một trở n&ecirc;n xinh đẹp hơn. Ch&iacute;nh v&igrave; vậy, mỹ phẩm ch&iacute;nh l&agrave; sự lựa chọn tối ưu gi&uacute;p bảo vệ v&agrave; l&agrave;m đẹp cho da của bạn.</p>','<p>Cũng như&nbsp;<a href=\"https://www.sendo.vn/thoi-trang-nu/\">thời trang</a>, ng&agrave;y nay&nbsp;sức khỏe &amp; l&agrave;m đẹp chiếm giữ một phần v&ocirc; c&ugrave;ng quan trọng trong cuộc sống năng động. Tất cả những g&igrave; li&ecirc;n quan đến lĩnh vực l&agrave;m đẹp lu&ocirc;n được ph&aacute;i đẹp hết mực quan t&acirc;m, đặc biệt l&agrave; mỹ phẩm. Kh&ocirc;ng chỉ ri&ecirc;ng với ph&aacute;i đẹp, ngay cả nam giới hiện đại cũng quan t&acirc;m rất nhiều đến việc chăm s&oacute;c sức khỏe &amp; l&agrave;m đẹp.&nbsp;Chăm s&oacute;c da, dưỡng t&oacute;c, dưỡng thể&hellip; một c&aacute;ch to&agrave;n diện từ b&ecirc;n trong sẽ đem lại cho bạn một vẻ đẹp đầy sức sống, tươi trẻ để lu&ocirc;n được tự tin trong suốt một ng&agrave;y d&agrave;i l&agrave;m việc. Đặc biệt,&nbsp;những d&ograve;ng sản phẩm t&iacute;ch hợp nhiều t&iacute;nh năng v&agrave; khả năng t&aacute;i tạo v&agrave; bảo vệ da, hay cả những loại chỉ cần một c&ocirc;ng đoạn đơn giản cũng thay thế được kh&aacute; nhiều bước trang điểm quen thuộc th&ocirc;ng thường hiện đang rất được y&ecirc;u th&iacute;ch.</p>','2017-03-23 00:49:33','2017-03-23 00:49:33',0),(8,'ĐẸP HƠN MỖI NGÀY VỚI CÁC SẢN PHẨM CHĂM SÓC SỨC KHỎE & LÀM ĐẸP','images (2).jpg','<p>Sự đa dạng v&agrave; phong ph&uacute; của mỹ phẩm d&agrave;nh cho nữ chắc chắn sẽ gi&uacute;p c&aacute;c bạn g&aacute;i c&oacute; th&ecirc;m nhiều lựa chọn th&iacute;ch hợp. Từ kem dưỡng da, kem l&agrave;m trắng, sữa rửa mặt cho đến xịt kho&aacute;ng,... tất cả đều sẽ gi&uacute;p bạn ho&agrave;n thiện hơn vẻ đẹp của m&igrave;nh. Những thương hiệu nổi bật bạn kh&ocirc;ng n&ecirc;n bỏ qua: kem dưỡng da The Face Shop, sữa rửa mặt Olay, xịt kho&aacute;ng Avene,..</p>','<p>Với nhu cầu sử dụng&nbsp;ng&agrave;y c&agrave;ng cao, c&aacute;c h&atilde;ng sản xuất cũng ng&agrave;y c&agrave;ng cho ra đời nhiều hơn c&aacute;c loại sản phẩm đ&aacute;p ứng đầy đủ c&aacute;c yếu tố an to&agrave;n v&agrave; chất lượng. Đặc biệt, khi mua sắm c&aacute;c sản phẩm chăm s&oacute;c sức khỏe &amp;&nbsp;l&agrave;m đẹp tại Senndo.vn, bạn kh&ocirc;ng chỉ được trải nghiệm kh&ocirc;ng gian hiện đại m&agrave; c&ograve;n thường xuy&ecirc;n được hưởng những ch&iacute;nh s&aacute;ch giảm gi&aacute;, ưu đ&atilde;i cực kỳ cao.</p>\r\n\r\n<p>Sendo.vn mua b&aacute;n đảm bảo, giao h&agrave;ng to&agrave;n quốc, kh&aacute;ch h&agrave;ng được đổi, trả, khiếu nại v&agrave; nhận ho&agrave;n 100% ph&iacute; mua h&agrave;ng nếu sản phẩm kh&ocirc;ng đ&uacute;ng m&ocirc; tả. Th&ocirc;ng tin kh&aacute;ch h&agrave;ng được bảo mật tuyệt đối v&agrave; nhiều chương tr&igrave;nh ưu đ&atilde;i giảm gi&aacute; hấp dẫn, gi&uacute;p kh&aacute;ch h&agrave;ng mua sắm thật đảm bảo, tiết kiệm v&agrave; tiện &iacute;ch tại&nbsp;</p>','2017-03-23 00:51:47','2017-03-23 00:51:47',0),(9,'10 sản phẩm làm đẹp phổ biến đến từ Hàn Quốc','images.jpg','<p><em><strong>Kh&ocirc;ng thể phủ nhận sự đam m&ecirc; tột độ của c&aacute;c bạn g&aacute;i đối với sản phẩm l&agrave;m đẹp của H&agrave;n Quốc. Trong suốt những năm qua, c&aacute;c d&ograve;ng sản phẩm từ H&agrave;n Quốc như kem dưỡng ẩm, mặt nạ đất s&eacute;t, v&agrave; toner&hellip; lu&ocirc;n được t&igrave;m kiếm v&agrave; người d&ugrave;ng tin tưởng sử dụng.</strong></em></p>','<p>Dưới đ&acirc;y những sản phẩm H&agrave;n Quốc đang được phổ biến ở nước ngo&agrave;i v&agrave; nhận được sự ch&agrave;o đ&oacute;n nồng nhiệt tại thị trường lớn như Mỹ. C&ugrave;ng điểm qua 10 loại mỹ phẩm của H&agrave;n Quốc được y&ecirc;u th&iacute;ch v&agrave; l&agrave;m thay đổi th&oacute;i quen l&agrave;m đẹp của bạn.</p>\r\n\r\n<h2>Laneige Hai Tone Lip Bar</h2>\r\n\r\n<p>Nắm vững phong c&aacute;ch trang điểm m&ocirc;i theo xu hướng Ombre sẽ dễ d&agrave;ng hơn nhiều với Laneige Hai Tone Lip Bar, m&agrave; đi k&egrave;m trong đ&oacute; c&oacute; 10 sắc th&aacute;i k&eacute;p v&ocirc; c&ugrave;ng phong ph&uacute;. Việc thiết lập loại son gel để lại một kết th&uacute;c b&oacute;ng bổ sung cho một c&aacute;i nh&igrave;n căng đầy, tươi trẻ.<br />\r\nNếu bạn mới bắt đầu l&agrave;m quen với việc sử dụng son th&igrave; h&atilde;y chọn những m&agrave;u nhẹ nh&agrave;ng hơn như Red Blossom v&agrave; Pink Salmon. Sự kết hợp của &aacute;nh s&aacute;ng v&agrave; t&ocirc;ng m&agrave;u tối sẽ gi&uacute;p tạo đường vi&ecirc;n m&ocirc;i r&otilde; r&agrave;ng hơn.</p>','2017-03-23 00:53:30','2017-03-23 00:53:30',0),(10,'Bí quyết nuôi dưỡng sắc đẹp từ Nhật Bản','mau-poster-quang-cao-my-pham-duong-da-photoshop-1962.jpg','<p><em><strong>D&ugrave; chỉ mới ch&iacute;nh thức đặt ch&acirc;n v&agrave; thị trường mỹ phẩm Việt Nam. Thế nhưng, với bề d&agrave;y lịch sử h&igrave;nh th&agrave;nh v&agrave; ph&aacute;t triển trong suốt hơn 30 năm qua, SK-II đang từng bước chinh phục những t&iacute;n đồ l&agrave;m đẹp Việt những bởi hiệu quả thần k&igrave; m&agrave; n&oacute; mang lại.</strong></em></p>','<p>Nhật Bản &ndash; xứ sở nổi tiếng của hoa anh đ&agrave;o lu&ocirc;n khiến cả thế giới phải ng&atilde; mũ th&aacute;n phục bởi những ph&aacute;t minh v&agrave; c&ocirc;ng tr&igrave;nh vĩ đại. V&agrave; nền c&ocirc;ng nghiệp mỹ phẩm cũng kh&ocirc;ng nằm ngoại lệ. Mang phương ch&acirc;m &ldquo;những g&igrave; tốt cho sức khỏe cũng đều tốt cho l&agrave;n da&rdquo;, trải qua nhiều c&ocirc;ng tr&igrave;nh nghi&ecirc;n cứu v&agrave; t&igrave;m t&ograve;i từ những sản phẩm quen thuộc đến từ tự nhi&ecirc;n. Thương hiệu SK-II ra đời như một minh chứng h&ugrave;ng hồn cho tư duy &ldquo;những g&igrave; đến từ thi&ecirc;n nhi&ecirc;n đều tốt&rdquo;.</p>\r\n\r\n<p>Vươn xa thị trường Nhật Bản, SK-II c&ograve;n l&agrave; c&aacute;i t&ecirc;n được rất nhiều ng&ocirc;i sao h&agrave;ng đầu Hollywood y&ecirc;u th&iacute;ch: Cate Blanchette, Kate Bosworth v&agrave; Courteney Cox đều l&agrave; những fan cuồng của thương hiệu n&agrave;y. Điểm đặc biệt khiến SK-II kh&ocirc;ng ngừng &ldquo;l&agrave;m mưa l&agrave;m gi&oacute;&rdquo; tr&ecirc;n thị trường mỹ phẩm hiện nay ch&iacute;nh l&agrave; tinh chất Pitera độc quyền chỉ c&oacute; trong những d&ograve;ng sản phẩm SK-II, n&oacute; được v&iacute; von tựa như &ldquo; nước th&aacute;nh&rdquo;, gi&uacute;p da hồi sinh lại vẻ trong trẻo tự nhi&ecirc;n cho l&agrave;n da. Tinh chất Pitera được chắt lọc tinh t&uacute;y từ qu&aacute; tr&igrave;nh sản xuất rượu sake. Nhờ đ&oacute;, c&aacute;c sản phẩm của SK-II gi&uacute;p l&agrave;n da s&aacute;ng hơn, đều m&agrave;u, &iacute;t nếp nhăn v&agrave; &iacute;t chảy xệ hơn.</p>\r\n\r\n<p>C&ugrave;ng điểm xem một v&agrave;i d&ograve;ng sản phẩm đ&igrave;nh đ&aacute;m được nhiều người ưu chuộng của nh&atilde;n h&agrave;ng mỹ phẩm n&agrave;y</p>','2017-03-23 01:01:49','2017-03-23 01:01:49',0),(11,'demo1','1.png','<p>Đ&acirc;y la demo&nbsp; fgfgfgfgfg11</p>','<p>Đ&acirc;y la dfgfgfgfgfgfgemo 1</p>','2017-05-26 03:24:52','2017-05-26 03:49:26',1);
