INSERT INTO `products` VALUES (1,38,5,'Phấn nước April Skin',350000.00,'2017-03-22','on','phannen1.JPG','<p><strong>Phấn nước April Skin&nbsp;Magic Snow Cushion</strong>&nbsp;l&agrave; phấn nước t&aacute;c dụng 3 trong 1 vừa l&agrave; phấn phủ, vừa l&agrave; kem nền v&agrave; vừa l&agrave; kem che khuyết điểm cực tốt.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>','<p><strong>Phấn nước April Skin&nbsp;Magic Snow Cushion</strong>&nbsp;l&agrave; phấn nước t&aacute;c dụng 3 trong 1 vừa l&agrave; phấn phủ, vừa l&agrave; kem nền v&agrave; vừa l&agrave; kem che khuyết điểm cực tốt. Bạn sẽ kh&ocirc;ng c&ograve;n lo lắng về một l&agrave;n da mụn hay nhiều khuyết điểm. L&agrave;n da của bạn sẽ lu&ocirc;n mịn m&agrave;ng tươi s&aacute;ng kh&ocirc;ng t&igrave; vết.</p>\r\n\r\n<p>Thiết kế vỏ hộp&nbsp;<strong>phấn nước April Skin Magic Snow Cushion</strong>&nbsp;với t&ocirc;ng m&agrave;u đen sang trọng, huyền b&iacute; với b&ocirc;ng đ&aacute;nh đi k&egrave;m. Hộp chắc chắn v&agrave; cầm chắc tay</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Với&nbsp;<strong>Phấn nước April Skin Magic Snow Cushion</strong>&nbsp;c&aacute;c khuyết điểm sẽ kh&ocirc;ng c&ograve;n l&agrave; nỗi lo bởi khả năng&nbsp;che khuyết điểm của&nbsp;<strong>April Skin Magic Cushion</strong>&nbsp;thực sự&nbsp;vượt trội hơn hẳn so với c&aacute;c d&ograve;ng Cushion kh&aacute;c.</p>\r\n\r\n<p>+ Khả năng che phủ ho&agrave;n hảo gi&uacute;p che phủ tốt những khuyết điểm tr&ecirc;n da,</p>\r\n\r\n<p>+ Duy tr&igrave; lớp trang điểm trong thời gian d&agrave;i kh&ocirc;ng bị xuống t&ocirc;ng m&agrave;u,</p>\r\n\r\n<p>+ Tạo cảm gi&aacute;c da mượt m&agrave;, mướt m&agrave; kh&ocirc;ng bị mốc hay kh&ocirc; da,</p>\r\n\r\n<p>+ Độ kiềm dầu tốt, ph&ugrave; hợp với c&aacute;c bạn da dầu hay da hỗn hợp v&agrave; cả da thường,</p>\r\n\r\n<p>+ Kết cấu kem mềm của phấn nước&nbsp;April Skin Magic Snow Cushion&nbsp;mỏng mịn gi&uacute;p tăng khả năng b&aacute;m tr&ecirc;n da v&agrave; kh&ocirc;ng bị bết d&iacute;nh,</p>\r\n\r\n<p>+ Chỉ số chống nắng cao, rất ph&ugrave; hợp với kh&iacute; hậu nắng n&oacute;ng của nước ta.</p>\r\n\r\n<p>Đ&oacute; l&agrave; tất cả những ưu điểm nổi bật của&nbsp;<strong>Phấn nước April Skin Magic Snow Cushion</strong></p>',1522,0.00,22,'1','2017-03-21 21:18:08','2017-05-26 20:28:10',0),(2,40,9,'Kem Che Khuyết Điểm dưỡng trắng tạo nền POND Thái',100000.00,'2017-03-09','on','images.jpg','<p>Trắng kh&ocirc;ng tỳ vết</p>','<p>Phủ ngay khuyết điểm&nbsp;<a href=\"https://www.sendo.vn/duong-trang.htm\">dưỡng trắng</a>&nbsp;d&agrave;i l&acirc;u.</p>\r\n\r\n<p>_ Che phủ tức th&igrave; c&aacute;c vết th&acirc;m n&aacute;m v&agrave; khuyết điểm tr&ecirc;n da, cho l&agrave;n da trắng mịn đều m&agrave;u ngay khi sử dụng, với c&ocirc;ng thức che phủ ưu việt GenActivTMCOVER.</p>\r\n\r\n<p>_ Dưỡng trắng v&agrave; giảm th&acirc;m n&aacute;m từ s&acirc;u b&ecirc;n trong, đồng thời bảo vệ da hiệu quả dưới t&aacute;c hại của tia UVA &amp; UVB với SPF30PA++.</p>',1545,20.00,1,'0','2017-03-21 23:18:49','2017-05-27 01:58:45',0),(3,38,8,'Phấn Nước Kiềm Dầu Oil1',145000.00,'2017-03-23','on','phannen2.JPG','<p><strong>Phấn Nước Kiềm Dầu Oil Control Water Cushion&nbsp;</strong></p>\r\n\r\n<p><strong>Oil Control Water Cushion</strong>&nbsp;l&agrave; d&ograve;ng phấn nước mới nhất&nbsp; nhằm giải tỏa cơn kh&aacute;t &rdquo; sự xinh đẹp&rdquo; cho &ldquo;l&agrave;n da&rdquo; &nbsp;hỗn hợp, da dầu, da si&ecirc;u dầu, da super dầu :))))))).</p>','Phấn Nước Kiềm Dầu Oil Control Water Cushion \r\nOil Control Water Cushion là dòng phấn nước mới nhất  nhằm giải tỏa cơn khát ” sự xinh đẹp” cho “làn da”  hỗn hợp, da dầu, da siêu dầu, da super dầu :))))))). \r\nThật sự không hề vô căn cứ khi nói giải tỏa cơn khát ^^. Da dầu vốn dĩ là da thiếu nước, da càng tiết nhiều dầu, nhiều bã nhờn thì càng cho thấy dấu hiệu thiếu nước của da. Chính do vậy từ trước tới nay, nhiều bạn luôn băn khoăn về việc muốn tạo hiệu ứng căng bóng nhưng lại lo ngại về việc da theo đó mà đổ quá nhiều dầu bóng nhẫy. Giờ đây, Oil Control Water Cushion sẽ xóa băng 2 vấn đề nan giải này, dòng phấn nước mới nhất chứa hiệu quả kiềm dầu, hạn chế bã nhờn và cấp nước, tạo hiệu ứng căng bóng như sao Hàn mà nhờn dính không còn là vấn đề ^^. \r\nQuan trọng hơn chính là khả năng che khuyết điểm mà mọi người thường kì vọng từ các dòng phấn nước, do lo ngại về độ che phủ 1 số dòng cũ chưa được thì. Lại thêm 1 ưu điểm nữa được đẩy thêm vào “sao Hàn mới nổi Oil Control Water Cushion” :))) – chính là khả năng che khuyết điểm vượt trội hơn các dòng phấn nước trước đây, thậm chí hơn nhiều sản phẩm kem nền BB, CC hay BCD, kết cấu phấn tự tan trên da giúp phủ lấp cả những lỗ chân lông to,che đi vết thâm mụn,mụn đầu đen. Da láng mịn, căng bóng, không ngại đổ dầu mà vẫn cấp đầy độ ẩm cho da, không hề bị khô hay mốc phấn. \r\nTóm lại, Oil Control Water Cushion mới  chứa ưu điểm:\r\n1. Che phủ vượt trội hơn các dòng phấn nước cũ trước đây. \r\n2. Kết cấu hạt phấn tự tan và cấu trúc tự khô, cho bạn lớp Make up hoàn hảo, và vô cùng tự nhiên trong thời gian ngắn.\r\n3. Chứa ưu điểm vượt trội trong kiềm dầu và điều tiết bã nhờn,tuy nhiên lại tạo lớp nền căng mịn, cảm giác như da được uống nước đúng như tên gọi “Oil Control Water” Cushion.\r\n4. Long – Lastting: Giữ trên da lâu trôi, hạn chế việc phải make lại sản phẩm nhiều lần trong ngày, đặc biệt là vào mùa hè, mồ hôi và bã nhờn có thể gây xuống tone nền. Cho bạn lớp nền rạng rỡ. ^^\r\n5. Chỉ số chống nắng SPF50 PA+++: Khả năng chống nắng được bổ sung tối ưu cho 1 loại phấn nước.',1425,0.00,14,'1','2017-03-21 22:07:31','2017-05-25 21:55:20',0),(9,43,10,'Phấn Mắt Bourjois',190000.00,'2017-03-18','on','phấn mắt1.JPG','<p><a href=\"https://www.sendo.vn/phan-mat.htm\">Phấn mắt</a>&nbsp;Bourjois Ph&aacute;p - tone m&agrave;u sang trọng ph&ugrave; hợp đi tiệc - l&agrave; một sản phẩm của &ocirc;ng lớn Bourjois Ph&aacute;p .</p>','&lt;p&gt;&lt;a href=&quot;https://www.sendo.vn/phan-mat.htm&quot;&gt;Phấn mắt&lt;/a&gt;&amp;nbsp;Bourjois Ph&amp;aacute;p - tone m&amp;agrave;u sang trọng ph&amp;ugrave; hợp đi tiệc - l&amp;agrave; một sản phẩm của &amp;ocirc;ng lớn Bourjois Ph&amp;aacute;p .&lt;/p&gt;',172,30.00,1,'1','2017-03-21 23:31:40','2017-05-27 01:58:45',0),(61,49,8,'AAA',13.00,'2017-03-18','1','phannen1.JPG','&lt;p&gt;12312312&lt;/p&gt;','<p>123123213</p>',123,10.00,10,'1','2017-03-22 02:18:10','2017-05-26 20:11:47',0),(66,44,8,'MASCARA MILKY DRESS',295000.00,'2017-03-18','1','mascara1.JPG','&lt;p&gt;&lt;strong&gt;&lt;a href=&quot;https://www.sendo.vn/milky-dress.htm&quot;&gt;Milky Dress&lt;/a&gt;&amp;nbsp;Barbie Make Mascara&lt;/strong&gt;&lt;/p&gt;','&lt;p&gt;&lt;strong&gt;&lt;a href=&quot;https://www.sendo.vn/milky-dress.htm&quot;&gt;Milky Dress&lt;/a&gt;&amp;nbsp;Barbie Make Mascara&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;C&amp;ocirc;ng dụng&lt;/strong&gt;: Gi&amp;uacute;p h&amp;agrave;ng mi d&amp;agrave;i d&amp;agrave;y v&amp;agrave; cong tự nhi&amp;ecirc;n gi&amp;uacute;p nu&amp;ocirc;i dưỡng l&amp;agrave;n mi được khỏe mạnh kh&amp;ocirc;ng g&amp;atilde;y rụng tạo sự hấp dẫn cho đ&amp;ocirc;i mắt bạn.Thiết kế đầu cọ độc đ&amp;aacute;o gi&amp;uacute;p giữ nếp chuốt mi đều kh&amp;ocirc;ng bị bết d&amp;iacute;nh kh&amp;ocirc;ng lem khi tiếp x&amp;uacute;c với nước.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;C&amp;aacute;ch D&amp;ugrave;ng&lt;/strong&gt;: Chuốt mi từ b&amp;ecirc;n trong ch&amp;acirc;n mi ra ngo&amp;agrave;i.&lt;/p&gt;',17845,10.00,1,'1','2017-03-22 03:28:14','2017-03-22 21:51:53',0),(67,37,5,'mat',158421.00,'2017-03-18','1','87a984_simg_63a662_340x340_maxb.jpg','&lt;p&gt;fxdgfcg&lt;/p&gt;','<p>fhgfhgjgh</p>',1245,10.00,3,'1','2017-03-24 02:11:51','2017-05-26 20:03:22',0),(68,45,6,'demo',65000.00,NULL,'0','2.JPG','&lt;p&gt;Đ&amp;acirc;y l&amp;agrave; sản phẩm demo&lt;/p&gt;','&lt;p&gt;Đ&amp;acirc;y l&amp;agrave; sản phẩm demo&lt;/p&gt;',1,NULL,0,'1','2017-05-26 00:14:21','2017-05-26 00:50:28',1),(69,37,8,'demo111',500005.00,NULL,'0','1.png','&lt;p&gt;Đ&amp;acirc;y l&amp;agrave; sản phẩm demo 2&lt;/p&gt;','<p>Đ&acirc;y l&agrave; 